import {Box,HStack} from '@chakra-ui/react';

export default function AfterSignIn(){
    return(
        <Box m='4'>
            <HStack>
                <Image src='https://www.kindmeal.my/images/icon_tick.png' alt='success'/>
            </HStack>
        </Box>
    )
}
